import ExpenseItem from './ExpenseItem';
import Card from './Card';
import './Expenses.css';
import ExpensesFilter from './ExpensesFilter';

function Expenses(props) {

const onYearFilterHandler=selectedYear=> {
  console.log(selectedYear);
}

  return (
    <div>    
    <Card className="expenses">
    <ExpensesFilter onYearFilter={onYearFilterHandler}/>
      <ExpenseItem
        topic={props.items[0].title}
        price={props.items[0].amount}
        purchaseDate={props.items[0].date}
      />
      <ExpenseItem
        topic={props.items[1].title}
        price={props.items[1].amount}
        purchaseDate={props.items[1].date}
      />
      <ExpenseItem
        topic={props.items[2].title}
        price={props.items[2].amount}
        purchaseDate={props.items[2].date}
      />
      <ExpenseItem
        topic={props.items[3].title}
        price={props.items[3].amount}
        purchaseDate={props.items[3].date}
      />
    </Card></div>
  );
}

export default Expenses;
